// Interview.js
import React from 'react';
import { useParams } from 'react-router-dom';

const Interview = () => {
  const { subject } = useParams();

  const questions = {
    dbms: [
      'What is a primary key?',
      'Explain normalization and its types.',
      'What is SQL and how is it used?',
    ],
    python: [
      'What is a Python dictionary?',
      'Explain list comprehensions in Python.',
      'How does error handling work in Python?',
    ],
    java: [
      'What is object-oriented programming?',
      'Explain the concept of inheritance in Java.',
      'What are Java interfaces?',
    ],
    // Add more subjects and their questions here
  };

  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>Interview for {subject.toUpperCase()}</h1>
      <div style={{ textAlign: 'left', maxWidth: '600px', margin: '0 auto' }}>
        {questions[subject]?.map((question, index) => (
          <p key={index}>{index + 1}. {question}</p>
        )) || <p>No questions available for this subject.</p>}
      </div>
    </div>
  );
};

export default Interview;
